"use strict";Object.defineProperty(exports,"__esModule",{value:!0}),exports.default=exports.qsort=exports.qItem=void 0;var e=function(e,t,a,n){return{key:e,title:t,description:n,image:a?"images/".concat(e,"-").concat(a,".png"):"",rating:"Neutral"}};exports.qItem=e;var t={type:"Basic",title:"Programming Language Features",description:'In the two-part task below you\'ll need to rate various programming\n  language features according to positively or negatively they impact your\n  programming practice. In the second portion of the task you\'ll then be asked to\n  order the statements from "Most negatively impactful" through "Not impactful" to\n  "Most positively impactful". Each language feature has a brief description and\n  sometimes an example image or code snippet. If you\'re unsure how to rate a feature\n  rate it as Neutral.',statements:[],unsorted:[e("01","The ability to restrict or constrain function arguments","dependent-types",['Known as "dependent typing", this type system allows a type\'s definition\n      to depend on a value.',"In the example above, the factorial function is defined. It takes one\n      argument, an integer, but has an additional constraint applied to it. The\n      factorial function can only be called with natural numbers: numbers\n      greater than zero.","Attempting to call factorial(-1) would result in a compile-time error\n      meaning less run-time code is dedicated to input validation."]),e("02","Objects with the same members or structure may be used interchangeably","structural-typing",['Known as "structural typing", this system allows objects to be considered\n      equal if they share the same members.','In the code snippet, values of both the Person and Employee types\n      can be passed to the greet function as they both have a "name" field.']),e("03","The language has tagged union types to describe variants of a single type","sum-types",['Tagged unions, also known as "disjoint unions" are used to describe\n      a value that can take several different, but fixed, types. A special tag\n      is used to explicitly indicate which variant a value currently is.',"A traditional enum could be considered the most basic example of a tagged\n      union. Each member of the enum is a distinct tag such as Red, Orange, and\n      Green in the example above.","Each variant in the union can also store differing pieces data, as is the\n      case in the AudioNode example. The Oscillator variant holds Float values\n      for frequency and phase, while the Gain variant holds a single Float value\n      for amount.",'Finally, tagged unions can be parameterised for generic use of the type.\n      The Result type defined above has two variants, Success and Error, and two\n      type parameters, e and a. Depending on the needs of the programmer, types\n      such as "Result String Int" can now be used to indicate a value that may\n      be an error string or an integer.']),e("04","The language has untagged union types to unify several existing types","union-types",['Similar to disjoint unions, untagged unions describe a value that can be\n      one of sevaral types. As the name implies, untagged unions do not "tag"\n      each variant.','Untagged unions are used to say a value could be of type a OR type b, as\n      in the example above. The C code above defines a union of an int and a\n      float, and provides a mechanism to access either value. A similar thing\n      can be acheived in typescript, for example: "type foo = number | string".']),e("05","Types are dynamic and determined at run-time","dynamic-typing",["In dynamically typed languages, types are fluid and determined while the\n      program is running.","This makes it easy for developers to maniupulate and transform values,\n      but comes at the cost of having to check types manually at runtime.","The snippet shows how to check the type of a variable in javascript,\n      and shows that the type of a variable can change over it's lifetime."]),e("06","The language has a static type system that determines type correctness at compile-time","static-typing",["In statically typed languages, the type of a value is determined at compile\n      time and the compiler performs checks to ensure all the types in a program\n      match up.","Attempting to call a function that only takes integers with a string for\n      example, will result in a compile time error forcing the developer to fix\n      the problem.",'Some languages require all values and functions to have "type annotations"\n      whereas others can infer types based on their useage while still enforcing\n      correctness.']),e("07","The language has an undefined and/or null type and value","undefined-and-null",['Some languages have the notion of "undefined" or "null" (or both) to\n      describe values that do not exist.',"In javascript undefined is returned when trying to access object properties\n      that do not exist, and null is used to explicitly describe something with\n      no value.",'In the snippet, the greet function checks if the object has the\n      property "name" and uses that in the greeting if it exists. If no element\n      has the id "superCoolElement", then null is returned and so this should\n      be checked before trying to do anything with the "el" variable.']),e("08","Run-time errors are encoded at the type level and handled as normal values","error-types",['In some languages such as Java, errors are represented as "exceptions"\n      that are thrown and must be caught to prevent the program from crashing.\n      In other languages however, errors are represented as values like any\n      other and can be manipulated and passed around as normal.',"The Result type above demonstrates this. Instead of throwing an exception,\n      the Result type describes a computation that might fail, and forces the\n      developer to handle both cases whenever validating a month number."]),e("09","The language supports code macros","macros",['Some languages support macros as a means of generating or inserting\n      bits of code into an existing piece of code. The code snippet is\n      an example of a macro in C. When the compiler comes across any instances\n      of the word "double", it expands and inserts the macro into the source\n      code and then compiles that new piece of code instead.',"Lisp takes this concept even further, allowing lisp programs themselves\n      to manipulate macros, and so functions can be written to generate macros\n      at run-time."]),e("10","The language supports reflection and/or introspection","reflection-and-introspection",["Languages that support reflection and/or introspection are capable of\n      examining a program at run-time. In doing so, these programs are able to\n      modify their own structure or behaviour, defining new types and inspecting\n      the type or properties of values at run-time.","The above Java snippet gets all the methods defined in MyClass, and\n      prints their names to the console. Reflection is particularly useful for\n      serialising objects into a format such as JSON."]),e("11","The language has a comprehensive standard library covering areas such as UI, graphics, networking, and more complex audio constructs","",["The language provides packages or modules for a wide variety of programming\n      tasks as part of it's standard library.","These could include packages for creating and displaying user interfaces,\n      handling network requests, drawing graphics to the screen, or higher-level\n      audio elements such as complete synthesisers."]),e("12","Public packages must following the Semantic Versioning standard","semantic-versioning",["Some languages have tighter control on their package ecosystem. Elm uses\n      it's type system to analyse updates to packages and automatically works\n      out how to bump the package version.",'Semantic Versioning is a versioning standard that splits splits software\n      versions into MAJOR.MINOR.PATCH numbers such as 1.1.0. This serves as a\n      "contract" to consumers of a package, meaning that changes to a package\'s\n      API must result in a MAJOR version increase.']),e("13","The ability to evaluate strings as source code at run-time","eval",["In many interpretted languages (and some compiled ones), developers are\n      given the ability to evaluate a string as though it were source code.","This can be useful for allowing user input to be run and executed as code\n      or for code to be easily be dynamically generated and evaluated at run-time.","The code snippet shows the eval function in JavaScript. First, eval is\n      called to evluate the result of 2 * 20, and that result can be stored in\n      the x variable like normal. Notice how the second use of eval is able to\n      use existing variables, here x is being converted to a string and assigned\n      to y."]),e("14","Code testing is built into the language","first-class-tests",["Testing code can be an important part of some developers workflow. It\n      commonly involves testing a particular function or piece of code against\n      a variety of different inputs and making sure the output is what was\n      expected.","Various testing frameworks existing for many programming languages, but\n      some offer specific constructs for testing as part of the language itself.",'The code snippet is from the Pyret language. A simple double function is\n      defined using the "fun" keyword, but then two test cases are defined after\n      the "where" keyword. When the program is run, the test cases are evaluated\n      and an exception is thrown if the result does not match the expected output.']),e("15","Public packages must be fully documented before they are published","documentation",["In many languages it is a common convention to have special documentation\n      comments, such as the popular JavaDoc style, to provide structured\n      documentation for a function or package.","Some package repositories require the presence of these special comments\n      in any exposed function or class to help developers and consumers of the\n      package."]),e("16","The language has an online editor or playground","online-editor",["An online editor or playground allows developers to experiment with the\n      language without downloading anything or setting up any tooling.","It can also serve as a convinient scratchpad to quickly test ideas without\n      the bloat of a full editor or ide."]),e("17","There is an official formatter that formats source code to conform with a fixed style guide","",["It is not uncommon for there to be differing opinions among developers\n      around how source code should be written and formatted. So-called linters\n      exist to enforce a specific code style within a team or community.","Recently, languages have started provided official linters so that the\n      entire community conforms to a single style guide. This can be seen in\n      languages such as Go, Rust, and Elm."]),e("18","Programs can be constructed in a visual patcher environment","visual-patcher",['Some languages are visual rather than textual. Individual objects or\n      functions are connected together with wires in a visual "patcher" environment\n      that displays the flow of data in the program.']),e("19","There is an explorer for common and/or useful snippets of code, objects, or functions","explorer",["It is common for similar code snippets and patterns to be repeated\n      throughout a codebase, or across many codebases. A code snippet explorer\n      can help managage the smaller pieces of code, particularly in cases\n      where they tackle a specific or niche problem but the developer does not\n      want to create or find a package to import.","For programming languages that also provide their own editor or environment,\n      such a code snippet explorer might be included. It may also be possible\n      to share snippets with the community and search for others."]),e("20","Functions and packages can be searched for based on their type signature","type-search",["When a language has static typing, it opens up the possibility for a\n      codebase or package to be searched for based not just on names but on\n      type signatures as well.","Hoogle is one such example of this functionality. This can prove particularly\n      useful when developers know the result they want to achieve but not the\n      name of the function or want to explore different implementations with\n      the same type signature."]),e("21","There is an official linter that detects common problems and anti-patterns such as unused imports or duplicate variable names","linter",["A linter is a tool that detects bad practices, ineffecient code, or\n      common anti-patterns, and suggests how to fix those issues. These tools\n      are often maintained by the community and are configurable to taste.","Some languages, however, include an official linter as part of the\n      language distribution such as with Go. The benefit of such a linter is\n      that they are often not user-configurable, ensuring the entire community\n      is often adhering to the same standards and practices."]),e("22","User interfaces can be built using a drag-and-drop editor","gui-editor",["Some may find developing more complex user interfaces through plain\n      code cumbersome or difficult to manage. As an alternative, a number of\n      graphical editors exist to allow interface elements to be arranged on\n      a canvas and have the necessary code generated afterwards."]),e("23","All values are immutable and cannot be modified","",["In languages such as Haskell or Elm, values cannot be changed after being\n      defined. This means a suite of bugs related to mutating variables are no\n      longer a problem, but also means that new variables must be created whenever\n      we need to change something."]),e("24","Functions are pure and do not perform side effects","pure-functions",["Pure functions exhibit two key properties. The first is known as referential\n      transparency. This means that given the same input, the output is always\n      the same. The second is a guarantee that the function has no side effects\n      such as mutating variables or file I/O.","The code snippet contrasts a pure function to an impure one. The double\n      function behaves predictably and consistenly, but the addRandom function\n      does not. It mutates a global y variable, and uses Math.random meaning\n      the return value can change even when the arguments stay the same."]),e("25","Functions are first-class values and can be stored in variables and passed as arguments to other functions","first-class-functions",["First-class functions means that functions are not treated as a special\n      language construct or data type. They can be passed to other functions\n      or stored in variables, arrays, etc.","The code snippet shows a function being used as an argument to the\n      Array.map method. Array.map will then call that function on every element\n      in the array to transform it."]),e("26","Variable names cannot be shadowed","shadowing",['Shadowing refers to the practice of creating a new variable with the\n      same name as another variable in the outer scope. This can be convinient\n      when shadowing generic variable names such as "x" in the code snippet, but\n      can also make code more difficult to read as developers must have to\n      remember which "x" is available in the current scope.']),e("27","The language supports objects with local properties and methods","objects",["In object-oriented programming, a particular domain is modelled around\n      objects which contain some local state and some methods to manipulate\n      that state. This is principally a way of controlling encapsulation: certain\n      properties or state can be hidden and made accessible or modifiable via\n      an object's methods."]),e("28","The language enforces a specific type of application structure or architecture","",["There are many different ways to architecture and structure an applications.\n      Some languages take a more opinionated approach and impose a particular\n      architecture, or the language design makes a particular structure easier\n      to adopt.","The code snippet shows a simple Csound program. All programs must have a\n      <CsInstruments> tag and a <CsScore> tag, even if they are left empty.","This can be a benefit to a community as it becomes easier to read other\n      people's code, but can also pose unhelpful restrictions when a developer\n      wants to do something discouraged or outright impossible."]),e("29","A program can be edited while it is running and changes are reflected in real-time","",["Known as hot reloading, or hot module replacemenet, this technology allows\n      a program to be edited while it is running without restarting the entire\n      application.","This is particularly prevalent in web development, where it is often\n      desireable to persist application state while changing UI or design\n      elements."]),e("30","There is a foreign function interface (FFI) to call functions written in different languages","",["Some languages have a special ability to call functions or even import types\n      and data structures from a separate language. Most commonly, languages have\n      an FFI for calling C code to give developers access to high performance code\n      when they need it.","This isn't the only use for an FFI, however. For languages built on a common\n      platform, an FFI can allow those languages to share code and data structures\n      as is the case in .NET languages like C#, F#, and BASIC."]),e("31","Functions can be partially applied by supplying on some of it's arguments","partial-application",["Partial application makes it easy to create new functions by supplying only\n      some of the arguments to an existing function.","The code snippet shows the definition of an add function, and then a new\n      add10 function being created by only supplying on argument to that add\n      function."]),e("32","The language has a different syntax for different parts of a program","different-syntax",["Instead of keeping the same syntax for all parts of a program, some languages\n      attempt to have different syntax (and sometimes semantics) more specifically\n      tailored to each part.","The code snippet is a simple example from Csound. Different parts of the\n      program are encapsulated in XML-style tags, and each have their own unique\n      sytnax. The CsScore is wildly different from the CsInstruments section, for\n      example, but both benefit from being specifically designed for that part of\n      the program."]),e("33","Compiler errors have a specific error code associated with them that can be used to find out more information about a particular error","error-codes",["Sometimes a compiler or run-time error can have an explanation or additional\n      information that is not practical to print to the terminal/console. In those\n      cases the language might provide a specific error code that can be looked up\n      in the language's reference for more information.","The image shows an example from Rust's error code reference, in this case\n      the error code is E00299. It features an explanation on how the error is\n      produced and a code example to exemplify that."]),e("34","The compiler provides suggestions on how to fix a compiler error","compiler-suggestions",["Some languages are able to offer suggestions or provide a more detailed\n      error message during compile or run-time errors. When done well they can\n      help developers quickly fix broken code or identify issues.","The image is an example from a compiler error thrown by the Elm programming\n      language; notice how it provides the important information (there is a type\n      mismatch between string and number), but also recognises that the wrong\n      operator may have been used as instea."]),e("35","Compiler errors link directly to the portion of source code that caused the error","",["For languages with their own editors or good integration with existing editors,\n      it can be possible to jump straight to error-producing code from an error\n      message itself.","This can save developers time by not having to hunt around their codebase,\n      particular when there are many files or lots of lines of code."]),e("36","Code can be compiled in a debug mode that allows events to be rewound and stepped through in time","time-travel",["It is not uncommon for a language to offer a debugger that allows deevelopers\n      to place break points to pause code execution and inspect the current program\n      state. For applications that rely on user interaction, another type of debugger\n      exists that records interaction events and allows them to be rewound and\n      played back."])]};exports.qsort=t;var a=t;exports.default=a;
